window.bookSummaryJSON = "<p><b>What’s Better than a Two Front War? A Three Front One</b></p> <p>Lizards, Goblins and the Created. Pick one and they were coming from all directions. As Matt expands, he finds himself in ever greater conflicts. Now his opponent’s are striking at him from all sides, with previously safe directions at risk.</p> <p>Good thing he’s got new Heroes, new units and new tricks up his sleeves. The only question plaguing him now is, why him? And what, if any, is the end game?<br> <br> <i>Magic Kingdom at War</i> is a tactical, base-building, crunchy LitRPG novella series by Tao Wong, bestselling author of the <i>System Apocalypse, A Thousand Li, Climbing the Ranks, the Hidden Universe, </i>and <i>Adventures on Brad</i> series.</p>"; 
